import React, { useEffect, useState } from 'react'
import axiosDB from '../../../utils/axios/axiosConfig'
import Navigation from '../../ui/Navigation/Navigation'
import './Boosts.css'
import Popup from './Popup'

// Import your icon images here
import bucketIcon from '../../../assets/pictures/bucket.svg'
import robotIcon from '../../../assets/pictures/robot.svg'
import saltIcon from '../../../assets/pictures/salt.svg'
import shovelIcon from '../../../assets/pictures/shovel.svg'
import skinIcon from '../../../assets/pictures/skin.svg'
import tapIcon from '../../../assets/pictures/tap.svg'

const Boosts = () => {
	const telegramId = '1145622789'

	// State for boost data and user data
	const [boostData, setBoostData] = useState([])
	const [userData, setUserData] = useState({})
	const [popupInfo, setPopupInfo] = useState({
		title: '',
		iconSrc: '',
		boostType: '',
		name: '',
	})

	useEffect(() => {
		const fetchUserData = async () => {
			try {
				const response = await axiosDB.get(`/boost/${telegramId}`)
				const userData = response.data.userData[0]
				setBoostData(userData.boosts)
				setUserData(userData)
			} catch (error) {
				console.error('Failed to fetch boost data:', error)
			}
		}

		fetchUserData()
	}, [telegramId])

	const updateBoostData = async () => {
		try {
			const response = await axiosDB.get(`/boost/${telegramId}`)
			const userData = response.data.userData[0]
			setBoostData(userData.boosts)
			setUserData(userData)
		} catch (error) {
			console.error('Failed to fetch updated boost data:', error)
		}
	}

	const allBoosts = [
		{
			name: 'energy',
			icon: 'lightning.svg',
			boostType: 'SoldoZecchino',
			price: '10000',
		},
		{
			name: 'turbo',
			icon: 'golden.svg',
			boostType: 'SoldoZecchino',
			price: '10000',
		},
		{ name: 'tap', icon: tapIcon, boostType: 'SoldoZecchino', price: '10000' },
		{
			name: 'auto',
			icon: robotIcon,
			boostType: 'SoldoZecchino',
			price: '10000',
		},
		{
			name: 'skin',
			icon: skinIcon,
			boostType: 'SoldoZecchino',
			price: '10000',
		},
		{
			name: 'shovel',
			icon: shovelIcon,
			boostType: 'PinocchioCoin',
			price: '1 zecchino',
		},
		{
			name: 'bucket',
			icon: bucketIcon,
			boostType: 'PinocchioCoin',
			price: '1 zecchino',
		},
		{
			name: 'salt',
			icon: saltIcon,
			boostType: 'PinocchioCoin',
			price: '1 zecchino',
		},
	]

	const handleMenuItemClick = name => {
		// Handle menu item click logic
	}

	const handleBoostClick = (
		title,
		iconSrc,
		boostType = 'default-boost',
		name
	) => {
		setPopupInfo({ title, iconSrc, boostType, name })
	}

	const handlePopupClose = () => {
		setPopupInfo({ title: '', iconSrc: '', boostType: '', name: '' })
	}

	return (
		<div className='container'>
			{popupInfo.title && (
				<Popup
					handlePopupClose={handlePopupClose}
					popupInfo={popupInfo}
					buttonText={
						popupInfo.boostType !== 'SoldoZecchino' ? 'Get' : 'Upgrade'
					}
					userData={userData}
					updateBoostData={updateBoostData}
				/>
			)}

			<h1 className='main-title'>Boosts</h1>
			<h3 className='post-title'>Free Day Boosts</h3>

			<div className='day-boosts'>
				{boostData.map(boost => (
					<button
						key={boost.name}
						className='block day-boost'
						onClick={() =>
							handleBoostClick(
								boost.name,
								boost.icon,
								boost.boostType,
								boost.name
							)
						}
					>
						<div id='boost-info'>
							<h3 className='up-case'>{boost.name}</h3>
							<h3 className='up-case' id='timer'>
								{/* Calculate time difference in hours */}
								{boost.level - boost.usesToday}
								{/* Show countdown timer in hours */}
								<p>
									{Math.floor(
										(Date.now() - new Date(boost.lastUsed)) / (1000 * 60 * 60)
									)}{' '}
									hours ago
								</p>
							</h3>
						</div>
						<div className='icon'>
							<img src={boost.icon} alt={boost.name} />
						</div>
					</button>
				))}
			</div>

			<h3 className='up-case text-center post-title'>Boosts</h3>
			<div className='boost-menu'>{/* Menu items and filtered boosts */}</div>

			<Navigation />
		</div>
	)
}

export default Boosts
